import React from 'react';
import classes from './Dialogs.module.css'
import {NavLink} from "react-router-dom";

const DialogItem = (props) => {

    let path = '/dialogs/' + props.id;

    return (
    <div className={classes.dialog + ' ' + classes.active}>
        <NavLink to={path}>{props.name}</NavLink>
    </div>
    )
}

const Dialogs = (props) => {
    return (
        <div className={classes.dialogs}>
            <div className={classes.dialogsItems}>
                <DialogItem name='Cyril' id='1'/>
                <DialogItem name='Ilya' id='2'/>
                <DialogItem name='Nata' id='3'/>
                <DialogItem name='Andy' id='4'/>
                <DialogItem name='Kate' id='5'/>
                <DialogItem name='Max' id='6'/>
            </div>
            <div className={classes.messages}>
                <div className={classes.message}>Hola!</div>
                <div className={classes.message}>How is it going?</div>
                <div className={classes.message}>Check out my new project!</div>
            </div>
        </div>
    )
}

export default Dialogs;
